/*
 - Find out if we're on ekstrabladet dk and an article.
 - Close button
 - Background and logo as base64
 - jQuery animations
*/
var $ = (function (document, $) {
  var element = Element.prototype,
      nodeList = NodeList.prototype,
      forEach = 'forEach',
      trigger = 'trigger',
      each = [][forEach],
      dummy = document.createElement();

  nodeList[forEach] = each;

  element.on = function (event, fn) {
    this.addEventListener(event, fn, false);
    return this;
  };

  nodeList.on = function (event, fn) {
    each.call(this, function (el) {
      el.on(event, fn);
    });
    return this;
  };

  element.trigger = function (type, data) {
    var event = document.createEvent('HTMLEvents');
    event.initEvent(type, true, true);
    event.data = data || {};
    event.eventName = type;
    event.target = this;
    this.dispatchEvent(event);
    return this;
  };

  nodeList.trigger = function (event) {
    each.call(this, function (el) {
      el[trigger](event);
    });
    return this;
  };

  $ = function (s) {
    var r = document.querySelectorAll(s || 'â˜º'),
        length = r.length;
    return length == 1 ? r[0] : !length ? nodeList : r;
  };

  $.on = element.on.bind(dummy);
  $.trigger = element[trigger].bind(dummy);

  return $;
})(document);

function correctEnvironment(){
  var loc = location.href,
      matching = loc.match(/^(http:\/\/ekstrabladet\.dk)(.*)(\/article)(.*)(\.ece)$/g);

  return matching && matching.length;
}

function returnTpl(){
  var content = '';

  if (correctEnvironment()){
    var title = $('h1.rubrik').innerHTML,
        url = location.href.split('http://')[1];

    content +='<div class="button-wrapper">';
      content +='<h1>'+title+'</h1>';
      content +='<p>Tryk p&aring; knappen herunder for at f&aring; Nationen-kommentarerne l&aelig;st h&oslash;jt.';
      content +='<input type="submit" class="button" value="G&aring; til h&oslash;jtl&aelig;sning" onclick="location.href=\'http://deterosdersnakker.dk\/?a='+url+'\';" />';
    content +='</div>';
  }else{
    content +='<div class="button-wrapper">';
      content +='<h1>&AElig;V!</h1>';
      content +='<p>Du skal befinde dig p&aring; en artikel p&aring; <a href="http://ekstrabladet.dk">ekstrabladet.dk</a> for at kunne bruge denne bookmarklet.</p>';
      content +='<input type="button" class="button" value="G&aring; til ekstrabladet.dk" onclick="location.href=\'http://ekstrabladet.dk\';"  />';
    content +='</div>';
  }

  return content;
}


function applyCss(url){
  var headID = document.getElementsByTagName('head')[0];
  var cssNode = document.createElement('link');
  cssNode.type = 'text/css';
  cssNode.rel = 'stylesheet';
  cssNode.href = url;
  cssNode.media = 'screen';
  headID.appendChild(cssNode);
}

(function(){
  applyCss('http://deterosdersnakker.dk/css/bookmarklet.css');
 
  var element = document.createElement('div');
  element.id = "deods";
  
  var tmpl = returnTpl();

  tmpl = '<div><img class="deodslogo" src="'+returnLogo()+'" /></div>' + tmpl;
  
  element.innerHTML = tmpl;
  
  document.body.insertBefore(element, document.body.firstChild);
})();

